const script = `Version 6.3
temp := 'chany'
(0008,0008) := 'test'
(0010,0010) := temp
`;

(async () => {
    const { Anonymizer } = DicomEdit;
    const anonymizer = new Anonymizer(script, { test: 'hello' });
    anonymizer.loadDcm(_base64ToArrayBuffer(base64))
    await anonymizer.applyRules();

    console.log(anonymizer.outputDict)
    buffer = anonymizer.write()
    console.log(buffer)
})();


function _base64ToArrayBuffer(base64) {
    var binary_string = window.atob(base64);
    var len = binary_string.length;
    var bytes = new Uint8Array(len);
    for (var i = 0; i < len; i++) {
        bytes[i] = binary_string.charCodeAt(i);
    }
    return bytes.buffer;
}
</script>
